// DTask.js

import React, { useState } from 'react';

function DTask({ addTask, tasks }) {
  const [inputValues, setInputValues] = useState({
    sNo: '',
    batch: '',
    task: '',
    submissionDate: new Date().toISOString().slice(0, 10),
  });

  const handleChange = (event) => {
    const { name, value } = event.target;
    setInputValues({
      ...inputValues,
      [name]: value,
    });
  };

  const handleSubmit = (event) => {
    event.preventDefault();

    // Create a new task object and add it to the tasks array
    const newTask = { ...inputValues, id: Date.now() };
    addTask([...tasks, newTask]);

    // Clear the input fields after submission
    setInputValues({
      sNo: '',
      batch: '',
      task: '',
      submissionDate: new Date().toISOString().slice(0, 10),
    });
  };

  return (
    <div>
      <form onSubmit={handleSubmit}>
        <div className="mb-3">
          <label htmlFor="sNo" className="form-label">
            S.no
          </label>
          <input
            type="text"
            className="form-control"
            name="sNo"
            value={inputValues.sNo}
            onChange={handleChange}
          />
        </div>
        <div className="mb-3">
          <label htmlFor="batch" className="form-label">
            Batch
          </label>
          <input
            type="text"
            className="form-control"
            name="batch"
            value={inputValues.batch}
            onChange={handleChange}
          />
        </div>
        <div className="mb-3">
          <label htmlFor="task" className="form-label">
            Task:
          </label>
          <input
            type="text"
            className="form-control"
            name="task"
            value={inputValues.task}
            onChange={handleChange}
          />
        </div>
        <div className="mb-3">
          <label htmlFor="submissionDate" className="form-label">
            Submission Date
          </label>
          <input
            type="date"
            className="form-control"
            name="submissionDate"
            value={inputValues.submissionDate}
            onChange={handleChange}
          />
        </div>
        <button type="submit" className="btn btn-primary">
          Submit Task
        </button>
      </form>
      <div>&nbsp;</div>
      <h2>Task List</h2>
      <div className="card">
        <div className="card-body">
          <div className="table-responsive">
            <table className="table table-bordered" id="datatablesSimple">
              <thead>
                <tr>
                  <th>S.no</th>
                  <th>Batch</th>
                  <th>Task</th>
                  <th>Submission Date</th>
                </tr>
              </thead>
              <tbody>
                {tasks.map((task) => (
                  <tr key={task.id}>
                    <td>{task.sNo}</td>
                    <td>{task.batch}</td>
                    <td>{task.task}</td>
                    <td>{task.submissionDate}</td>
                  </tr>
                ))}
              </tbody>
            </table>
          </div>
        </div>
      </div>
    </div>
  );
}

export default DTask;
